response.about:
Потенциал, данный природой:

•долго живут, но считают себя не очень удачливыми (необходимо в детстве постараться научить их видеть во всем только хорошее);
•потребность справиться со своими недостатками и обрести душевное спокойствие;
•люди с тяжелым характером и непростой судьбой.
Черты личности:

•постоянное ощущение необходимости избавляться от внешних воздействий и собственных негативных эмоций (для позитивной реализации рекомендуется культивировать в себе смирение, альтруизм);
•подлинный обольститель и соблазнительница;
•потенциальный участник всевозможных нетрадиционных левых, ультрарадикальных течений.
Возможные негативные качества:

•иногда чувствуют себя глубоко несчастными и страдают от непонимания окружающих, от собственных комплексов и страхов;
•болезненно воспринимают неудачи и попадают в зависимость от алкоголя или наркотиков, влечет к себе «теневая» сторона жизни;
•толкают других на самые неожиданные поступки, порой очень и неприятные.
Здоровье:

•обычно живут долгую и плодотворную жизнь;
•бывают слабы здоровьем, но будут воспринимать это как вызов;
•будут бороться за внутреннюю и внешнюю чистоту;
•полезны голодание, пост, йога-практики, энергетические чистки, духовное самосовершенствование
